import React from "react";
import { Button } from "react-bootstrap";
import { FaPenAlt } from 'react-icons/fa'
import { RiDeleteBin6Line } from "react-icons/ri";



const ReadOnlyRow = ({ contact, handleEditClick, handleDeleteClick }) => {
  return (
    <>
      <tr className="row">
        <td className="col-4 text-truncate">{contact.fullName}</td>
        <td className="col-4 text-truncate">{contact.address}</td>
        <td className="col-4 d-flex justify-content-end">
          <Button
            className="mr-1 btn-sm "
            type="button"
            variant="outline-secondary"
            onClick={(event) => handleEditClick(event, contact)}
          >
            <FaPenAlt />
          </Button>

          <Button type="button" className="py-1 px-2" variant="outline-secondary" onClick={() => handleDeleteClick(contact.id)}>
          <RiDeleteBin6Line />
          </Button>
        </td>
      </tr>
    </>
  );
};

export default ReadOnlyRow;
